import { Button, Card, CardContent, CircularProgress, Grid, TextField, Typography } from '@mui/material'
import { useState, useEffect } from 'react'
import { useNavigate, useParams } from 'react-router-dom'

export default function NewMedidor() {
    const [task, setTask] = useState({
        rut: '',
        codigo: '',
        nombre: '',
        fecha_creacion: '',
        descripcion: '',
    })

    const [loading, setLoading] = useState(false)
    const [editing, setEditing] = useState(false)

    const navigate = useNavigate()
    const params = useParams()

    const handleSubmit = async (e) => {
        e.preventDefault();
        setLoading(true);

        // Validación adicional antes de enviar
        if (!validateRut(task.rut) || !validateCodigo(task.codigo)) {
            setLoading(false);
            return;
        }

        if (editing) {
            await fetch(`http://localhost:4000/medidores/${params.id}`, {
                method: 'PUT',
                headers: {
                    "Content-Type": "application/json"
                },
                body: JSON.stringify(task),
            });
        } else {
            await fetch('http://localhost:4000/medidores', {
                method: 'POST',
                body: JSON.stringify(task),
                headers: { 'Content-Type': 'application/json' },
            });
        }

        setLoading(false);
        navigate('/');
    };

    const handleChange = (e) => {
        const { name, value } = e.target;

        if (name === 'nombre' && !/^[a-zA-Z\s]*$/.test(value)) {
            return;
        }

        setTask({ ...task, [name]: value });
    };

    const validateRut = (rut) => {
        const rutRegex = /^\d{1,2}.\d{3}.\d{3}[-][0-9kK]{1}$/;
        return rutRegex.test(rut);
    };

    const validateCodigo = (codigo) => {
        const codigoRegex = /^[a-zA-Z0-9]*$/;
        return codigoRegex.test(codigo);
    };

    const loadTask = async (id) => {
        const res = await fetch(`http://localhost:4000/tasks/${params.id}`);
        const data = await res.json();
        setTask({
            rut: data.rut,
            nombre: data.nombre,
            direccion: data.direccion,
        });
        setEditing(true);
    };

    useEffect(() => {
        if (params.id) {
            loadTask(params.id);
        }
    }, [params.id]);

    return (
        <Grid container direction='column' alignItems='center' justifyContent='center'>
            <Grid item xs={3}>
                <Card sx={{ mt: 5 }} style={{ backgroundColor: '#1e272e', padding: '1rem' }}>
                    <Typography variant='5' textAlign='center' color='white'>
                        {editing ? "Edit" : "Agregar"}
                    </Typography>
                    <CardContent>
                        <form onSubmit={handleSubmit}>
                            <TextField
                                name='rut'
                                value={task.rut}
                                variant='filled'
                                label='Rut'
                                sx={{ display: 'block', margin: '.5rem 0' }}
                                onChange={handleChange}
                                inputProps={{ style: { color: 'white' } }}
                                InputLabelProps={{ style: { color: 'white' } }}
                                error={!validateRut(task.rut)}
                                helperText={!validateRut(task.rut) ? 'RUT no válido' : ''}
                            />
                            <TextField
                                name='codigo'
                                value={task.codigo}
                                variant='filled'
                                label='Código'
                                sx={{ display: 'block', margin: '.5rem 0' }}
                                onChange={handleChange}
                                inputProps={{ style: { color: 'white' } }}
                                InputLabelProps={{ style: { color: 'white' } }}
                                error={!validateCodigo(task.codigo)}
                                helperText={!validateCodigo(task.codigo) ? 'Código no válido' : ''}
                            />
                            <TextField
                                name='nombre'
                                value={task.nombre}
                                variant='filled'
                                label='Nombre'
                                sx={{ display: 'block', margin: '.5rem 0' }}
                                onChange={handleChange}
                                inputProps={{ style: { color: 'white' } }}
                                InputLabelProps={{ style: { color: 'white' } }}
                            />
                            <TextField
                                name='fecha_creacion'
                                value={task.fecha_creacion}
                                type='date'
                                variant='filled'
                                label='Fecha de Creación'
                                sx={{ display: 'block', margin: '.5rem 0' }}
                                onChange={handleChange}
                                inputProps={{ style: { color: 'white' } }}
                                InputLabelProps={{ style: { color: 'white' } }}
                            />
                            <TextField
                                name='descripcion'
                                value={task.descripcion}
                                variant='filled'
                                label='Descripción'
                                multiline
                                rows={4}
                                sx={{ display: 'block', margin: '.5rem 0' }}
                                onChange={handleChange}
                                inputProps={{ style: { color: 'white' } }}
                                InputLabelProps={{ style: { color: 'white' } }}
                            />
                            <Button variant='contained' color='primary' type='submit' disabled={!validateCodigo(task.codigo) || !validateRut(task.rut) || !task.nombre || !task.fecha_creacion}>
                                {loading ? <CircularProgress
                                    color='inherit'
                                    size={24}
                                /> : 'Guardar'}
                            </Button>
                        </form>
                    </CardContent>
                </Card>
            </Grid>
        </Grid>
    );
}
